pragma solidity ^0.8.0;
// import "./Dextr.sol";
import "./TradeHelper.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract TradeDxt is ERC20, TradeHelper {
    modifier onlyOwner() override(TradeHelper) {
        require(msg.sender == _owner, "Not owner of contract, cannot call function.");
        _;
    }
    constructor() ERC20("Dextr", "DXT") public payable {
        _owner = msg.sender;
        _mint(address(this), 1000000*(10 ** uint256(decimals()))); //total supply = 1 mil
    }
    modifier nonZeroAddress(address _receiver) {
        require(_receiver!=address(0), "Non-zero address check");
        _;
    }
    function transfer(address _account, uint256 _amount) public override returns (bool){ //transfer from contract to a user
        require(balanceOf(address(this)) >= 250000*(10 ** uint256(decimals())), "Transfer failed: Transfer amount exceeds reserve amount (250,000 tokens)");
        _transfer(address(this), _account, _amount*(10 ** uint256(decimals())));
        return true;
    }
    function buyDxt(address _buyer, uint256 _amount) public payable {
        //call from buyer's address
        require(msg.sender == _buyer && _amount < totalSupply(), "Error: Not enough Ether in address"); // && _convertToEth(_amount) > msg.value
        _transfer(address(this), _buyer, _amount * (10 ** uint256(decimals())));
        require(msg.value>0, "No ether sent");
        //payable(address(this)).call{value: _convertToEth(msg.value)}("");
        emit NewPurchase(_buyer, _amount*(10 ** uint256(decimals())));
    }
    function sellDxt(address payable _seller, uint256 _amount) public { //User sells dxt to contract
        require(_amount*(10 ** uint256(decimals())) <= balanceOf(_seller) && address(_seller).balance > _convertToEth(_amount), "Error: Seller - not enough tokens / contract: not enough ether");
        _transfer(_seller, address(this), _amount*(10 ** uint256(decimals())));
        _seller.transfer(_convertToEth(_amount));
        emit NewSale(_seller, _amount*(10 ** uint256(decimals())));
    }
    function contractBalance() public view returns (uint256) {
        return address(this).balance;
    }
    event NewPurchase(address indexed _buyer, uint256 indexed _amount);
    event NewSale(address indexed _seller, uint256 indexed _amount);
}
